import React, {Component} from 'react';
import groupPhoto from '../../assets/background.jpg';
import Button from '../Button/Button'
import './Group.css'
class Group extends Component {
    render() {
        return (
            <div className="group-container">
                <div className="group-container-img">
                <img src={groupPhoto} width="200px" height="200px"/>
                </div>
                <div className="group-container-info">
                <h3 className="group-title">{this.props.title}</h3>
                <div className="group-info-container">
                    <p>{this.props.location}</p>
                    <p>{this.props.time}</p>
                    <p>{this.props.date}</p>
                </div>
                <div className="group-text">
                    <p>{this.props.text}</p>
                </div>
                <div className="group-button-container">
                <Button text = "Записатись"/>
                </div>
                </div>
            </div>

        );
    }
}

export default Group;
